import axios from "axios";
export const GET_DOGS = "GET_DOGS";

export const getDogs = () => {
  return (dispatch) => {
    return fetch("localhost:3001/dogs")
      .then((response) => response.json())
      .then((response) => {
        dispatch({
          type: GET_DOGS,
          payload: response.message,
        });
      });
  };
